‚Å†
¬∑ ¬∑ ¬∑ ¬∑ ¬∑ ¬∑ ¬∑ ¬∑ ¬∑ ¬∑ ¬∑ ‚Å†
‚Å†
If you're pausing to read this right now, take a deep breath in, right now...‚Å†
‚Å†
Exhale deeply.‚Å†
‚Å†
One more deep breath in... then a little deeper...‚Å†
‚Å†
Exhale and vocalize the mantra AUM / OM.‚Å†
‚Å†
AUM/OM is a sacred sound and symbol in various religions and spiritual belief systems.  While the OM spelling is more commonly seen and known, I'm going to focus on the traditional AUM spelling for deeper understanding and reverence of the energy this sacred sound imparts.‚Å†
‚Å†
We spent a lot of time studying this one sound, it's three letters, and the various significances back in my first YTT course.‚Å†
‚Å†
AUM is the vibration by which the undifferentiated consciousness of all life brings all things into the phenomenal realm of manifestation. It is akin to other well-known sacred sounds such as Amen, Amin, and Hum.‚Å†
‚Å†
Anyone who studies energy understands the three forces of creation, the trifecta of energies which permeate all living matter...‚Å†
‚Å†
positive, neutral, negative‚Å†
light, shadow, dark‚Å†
creation, preservation, destruction‚Å†
birth, life, death‚Å†
son, father, spirit‚Å†
atman, paramatman, jiva-atman‚Å†
electron, neutron, proton‚Å†
...‚Å†
‚Å†
We were taught to spend 2/3 of our exhale and sound on the AU/O part of the sound, and the last 1/3 of our exhale and sounds on the M part of the sound.‚Å†
‚Å†
It's a truly meditative practice.  Purposely infusing your being with this sound over and over and over again helps lull the body, mind, and soul into such a state of peace, it's no wonder entire traditions commit to long practices of this singular Bija (seed) sound every single day.‚Å†
‚Å†
So breathe with me here, exhale and create this sacred sound with me here...‚Å†
‚Å†
[I'm doing it as I write, join in!]‚Å†
‚Å†
Deep breath in....‚Å†
‚Å†
Exhale AAAAUUUUMM‚Å†
‚Å†
Deep breath in....‚Å†
‚Å†
Exhale AAAAUUUUMM‚Å†
‚Å†
Deep breath in....‚Å†
‚Å†
Exhale AAAAUUUUMM‚Å†
‚Å†
Be here. Feel here. Breathe here. ‚ù§‚ú®üòâ‚Å†
