Alien Visitors - the V's (a reptilian race with human like skin) - led by mysterious queen Anna, with her daughter Lisa and her trusted aid Marcus, their operations out of motherships hovering over 29 global sites. Are they saviours? Or something more sinister. A fledgling resistance is determined to reveal the shocking truth lead by Erica Evans, helped by Father Jack Landry, reporter Chad Decker, terrorist Kyle Hobbs and aided by the Fifth Column (V resistance fighter) Ryan and Joshua (Anna's physician).
