Thoroughly enjoyed this show just so annoyed it got cancelled as the 2nd series was getting so good!
Yea the Green Screen was so totally obvious, and the CGI reptilian were very CGI, but it didn't stop me enjoying the story and the characters.
I think my fave characters were Erica she was a strong female leader trying to balance motherhood, being and FBI agent sworn to protect the V's while also being leader of the 5th Column, almost succeeding at both.
Anna was a deviously dangerous ruler, manipulating anyone and everyone to her way, not just followers but family as well a dangerous woman.
I liked the relationship between Taylor and Lisa seemed quite genuine after the initial meetings and Lisa was a very level headed person willing to do the right thing, I didn't much like the Hobbs and Erica fling I hoped that she and Father Jack would get together!
Liked they bought Diana back from the original V series (not that I even knew that I had to research it so may have to try and watch the original show.... Maybe) which meant there was a good connection.
Liked the character of Joshua and both his portrayals of being 5th coloum and dedicated follower to Anna very well played,just wish the 2nd season had him more 5th than follower.
Also glad that Chad became a resistance fighter, he needed to switch allegiances and I'm very glad he did, played Anna very well.";}i:238;a:1:{s:14:"comments_count";i:2;}i:239;a:1:{s:11:"likes_count";i:12;}i:240;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEufbAxFd7t";}i:241;a:1:{s:5:"image";s:248:"https://scontent-sin6-2.cdninstagram.com/v/t51.2885-15/e35/118702334_1637513106429410_184183000023963527_n.jpg?_nc_ht=scontent-sin6-2.cdninstagram.com&_nc_cat=102&_nc_ohc=65c1II2RDIcAX8H97l2&_nc_tp=18&oh=7c1db44f60e2f2f79c31df3865250c95&oe=5F7BC957";}i:242;a:1:{s:4:"type";s:5:"image";}i:243;a:1:{s:8:"owner_id";i:3033671713;}i:244;a:1:{s:14:"owner_username";s:0:"";}i:245;a:1:{s:14:"owner_fullname";s:0:"";}i:246;a:1:{s:9:"owner_pic";s:0:"";}i:247;a:1:{s:2:"id";s:19:"2390986640849645721";}i:248;a:1:{s:10:"short_code";s:11:"CEufa6OjDCZ";}i:249;a:1:{s:12:"created_time";i:1599247840;}i:250;a:1:{s:7:"caption";s:271:"üî• #trippy 
